import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './App.css';

const App = () => {
    // ... (other states unchanged)
    const [plotErrors, setPlotErrors] = useState({});

    // ... (other methods unchanged: handleFileSubmit, handleComputeHash, etc.)

    const handleImageError = (plot) => {
        setPlotErrors(prev => ({ ...prev, [plot]: true }));
    };

    // ... (render method, only showing the Algorithm Comparison section)
    return (
        <div className="min-h-screen bg-gradient-to-br from-blue-100 to-indigo-200 flex flex-col items-center p-6">
            {/* ... (other UI components unchanged) */}
            <div className="w-full max-w-2xl mt-8">
                {encryptionResult && encryptionResult.comparison_report && (
                    <div className="mb-8 p-6 bg-white rounded-xl shadow-lg">
                        <h2 className="text-2xl font-semibold mb-4 text-indigo-800">Algorithm Comparison</h2>
                        <p><strong>Best for Speed:</strong> {encryptionResult.comparison_report.best_speed}</p>
                        <p><strong>Best for Security:</strong> {encryptionResult.comparison_report.best_security}</p>
                        <div className="mt-4">
                            <h3 className="text-xl font-medium mb-2 text-indigo-600">Performance and Security Plots</h3>
                            {encryptionResult.comparison_report.plots.map((plot, index) => (
                                <div key={index} className="mb-4">
                                    {plotErrors[plot] ? (
                                        <p className="text-red-600">Failed to load plot: {plot}</p>
                                    ) : (
                                        <>
                                            <img
                                                src={`http://localhost:5000/api/plot/${encodeURIComponent(plot)}?t=${new Date().getTime()}`}
                                                alt={`Algorithm Comparison Plot ${index + 1}`}
                                                className="w-full max-w-[600px] my-2 rounded-lg shadow-md"
                                                onError={() => handleImageError(plot)}
                                            />
                                            <button
                                                onClick={() => window.open(`http://localhost:5000/api/plot/${encodeURIComponent(plot)}`, '_blank')}
                                                className="bg-blue-600 text-white p-2 rounded-lg hover:bg-blue-700 transition duration-200"
                                            >
                                                Download Plot {index + 1}
                                            </button>
                                        </>
                                    )}
                                </div>
                            ))}
                        </div>
                        <div className="mt-4">
                            <h3 className="text-xl font-medium mb-2 text-indigo-600">Comparison Metrics</h3>
                            <table className="w-full border-collapse border border-gray-300">
                                <thead>
                                    <tr className="bg-gray-100">
                                        <th className="border border-gray-300 p-2">Algorithm</th>
                                        <th className="border border-gray-300 p-2">Time (s)</th>
                                        <th className="border border-gray-300 p-2">Size (bytes)</th>
                                        <th className="border border-gray-300 p-2">Security Score</th>
                                        <th className="border border-gray-300 p-2">Key Strength (bits)</th>
                                        <th className="border border-gray-300 p-2">Vulnerabilities</th>
                                    </tr>
                                </thead>
                                <tbody>
                                    {encryptionResult.comparison_report.algorithms.map((alg, index) => (
                                        <tr key={index} className={alg === encryptionResult.algorithm.toLowerCase() ? 'bg-green-50' : ''}>
                                            <td className="border border-gray-300 p-2">{alg.toUpperCase()}</td>
                                            <td className="border border-gray-300 p-2">{encryptionResult.comparison_report.performance[alg].time.toFixed(4)}</td>
                                            <td className="border border-gray-300 p-2">{encryptionResult.comparison_report.performance[alg].size}</td>
                                            <td className="border border-gray-300 p-2">{encryptionResult.comparison_report.security[alg].score}</td>
                                            <td className="border border-gray-300 p-2">{encryptionResult.comparison_report.security[alg].key_strength}</td>
                                            <td className="border border-gray-300 p-2">
                                                {encryptionResult.comparison_report.security[alg].vulnerabilities.length > 0
                                                    ? encryptionResult.comparison_report.security[alg].vulnerabilities.join(', ')
                                                    : 'None'}
                                            </td>
                                        </tr>
                                    ))}
                                </tbody>
                            </table>
                        </div>
                    </div>
                )}
            </div>
        </div>
    );
};

export default App;
